import React, { Component} from 'react';
import  InputRange  from './InputSlider';

const value = 0;
class noValueSlider extends Component {
    render() {
        return (
            <form className="form">                
                <InputRange min={0} max={100} value={50} />
                <span>{value}</span>
            </form>
        );
    }
}


export default noValueSlider;
